const SignUp =()=>{

    const [name, setName] =useState("");
    const [email, setEmail] =useState("");
    const [password, setPassword] =useState("");

    return(
       <div className="custom-sign-up">
        <h2>Sign Up</h2>
        <div className="main-input-box">
        <input className="inputBox" type="text" onChange={(e)=>setName(e.target.value)} placeholder="Enter Name"/>

        <input className="inputBox" type="email" onChange={(e)=>setEmail} placeholder="Enter Email"/>

        <input className="inputBox" type="password" placeholder="Enter Password"/>

        <button type="submit" className="Sign-up-btn brn">Sign Up</button>
       </div>
       </div>
    )
}
export default SignUp;
